import { Component } from '@angular/core';

@Component({
  selector: 'app-grados',
  templateUrl: './grados.component.html',
  styleUrls: ['./grados.component.css']
})
export class GradosComponent {

}
<div class="contenedor">
  <div
    class="fbzKiw"
    style="
      background: linear-gradient(
        90deg,
        rgb(140, 82, 255) 0%,
        rgb(92, 225, 230) 100%
      );
    "
  >
  <div class="cabecera">
    <div class="title-cabe">
        <h2>EStudiantes</h2>
    </div>
  </div>
</div>
</div>
